data.eventLog.sort((e1, e2) => { return e1.timeStamp - e2.timeStamp });
let endTime = null;
let startTime = null;
for(let i = 0;i < data.eventLog.length;i++) {
  let currEvent = data.eventLog[i];
  if(startTime === null && (currEvent.name === 'start_climb')) {
    startTime = currEvent.timeStamp;
  }
  if(currEvent.name === 'fail_climb') {
    endTime = null;
	}
  if(currEvent.name === 'score_climb') {
    if(currEvent.variables.rung === 'traversal') {
    	endTime = currEvent.timeStamp;
    }
    else {
      endTime = null;
    }
	}
}
if(endTime === null || startTime === null) {
  return NaN;
}
return endTime - startTime;
